import React, { Component } from "react";

class Message extends Component {
  render() {
    switch (this.props.msg) {
      case "greet":
        return (
          <div className="greet">
            <code>
              <h1>HOW COOL IS THAT!?</h1>
            </code>
          </div>
        );
      case "gw":
        return (
          <div className="gw">
            <code>
              <h1>Game Won</h1>
              <div className="buttons">
                <button>Play Again</button>
                <button>Return To Form</button>
              </div>
            </code>
          </div>
        );
      case "go":
        return (
          <div className="go">
            <code>
              <h1>Game Over</h1>
            </code>
          </div>
        );
      default:
        return null;
    }
  }
}

export default Message;
